    [],nt"revision_timestamp": "2016-10-07T14:54:47.984606",nt"name": "2015-health-insurance-marketplace-plan-selections-by-zip",nt"isopen":
    true,nt"url": null,nt"notes": "<p>The dataset provides the total number
    of health plan selections by ZIP Code for the 37 states that use the HealthCare.gov
    platform, including the Federally-facilitated Marketplace, State Partnership Marketplaces
    and supported State-based Marketplaces. These data reflect the total number of consumers
    who selected a plan or were automatically re-enrolled for the 2015 coverage year
    as of January 16, 2015.</p>n<p>The dataset does not include plan selections from
    the District of Columbia and 13 other states that have State-based Marketplaces.</p>n<p>Data
    for ZIP Codes with 50 or fewer plan selections are not included to protect individuals
    privacy. A total of 13,725 ZIP Codes with at least 51 plan selections per ZIP Code
    are included in the table. These data account for 97 percent of the total 7.16 million
    overall plan selections in the 37 states as of January 16, 2015.</p>n<p>The sum
    of plan selections among ZIP Codes within a state using this dataset may not be
    equal to state-level totals provided in the state level snapshots. This is because
    ZIP Code-level data does not appear for ZIP Codes with 50 or fewer plan selections,
    and as a result the dataset does not include all plan selections within a state.</p>n",nt"license_title":
